window.bookSummaryJSON = "<p>Will Lee, the courageous and uncompromising senator from Georgia, is back - now as president of the United States - in this fifth book of the <i>New York Times</i> best-selling series that began with <i>Chiefs</i>. </p> <p>When a prominent conservative politician is killed inside his lakeside cabin, authorities have no suspect in sight. And two more seemingly different deaths might be linked to the same murderer. From a quiet DC suburb to the corridors of power to a deserted island hideaway in Maine, Will; his CIA director wife, Kate; and the FBI will track their man, set a trap - and await the most dangerous kind of quarry: a killer with a cause to die for.... </p>"; 
